    const blogs=useSelector(state => state.blog.blogs)

  return (
    <>
    <h2>Blogs</h2>
    {blogs.map(blog =>(
        <Blogs key={blog.id} blog={blog} />
    ))}
    </>
  )
}

export default BlogList
